import React, { Component } from "react";
import "./Tabs.css";
import TabContent from './TabContent'

class Tabs extends Component {
  constructor(props){
    super(props);
    this.state = {
      selected: "0"
    }
    this.handleChange = this.handleChange.bind(this);
  }

  handleChange(e) {
    this.setState({
      selected: e.target.id
    })
  }

  render() {
    return (
      <div className="tabs" id="2" onClick={e => {
        this.handleChange(e)
      }}>

      </div>
    );
  }
}

export default Tabs;
